    false,nt"url": null,nt"notes": "This annual narrative report for Union
    Slough National Wildlife Refuge and Wetland Management District summarizes Refuge
    activities during the 1993 calendar year.  The report begins with a summary of the
    yearu2019s highlights and climatic conditions.  Land acquisition is also covered.
     The report includes a planning section which discusses the management plan, public
    participation, and compliance with environmental and cultural resource mandates.
     Refuge administration is outlined; information about personnel, volunteer programs,
    funding, safety, and technical assistance is given.  Habitat management is also
    covered.  Subjects include wetlands, croplands, grasslands, haying, fire management,
    and pest control.  The wildlife section of the report discusses wildlife diversity,
    endangered species, threatened species, waterfowl, marsh birds, water birds, shorebirds,
    raptors, game mammals, fisheries resources, wildlife propagation and stocking, animal
    control, and marking/banding.  The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive exhibits, hunting, fishing, trapping, wildlife
    observation, picnicking, and law enforcement.  The equipment and facilities section
    of the report provides information about new construction, rehabilitation, major
    maintenance, equipment utilization/replacement, communications systems, and energy
    conservation.  Cooperative programs are provided at the end.",nt"license_title":
